require('dotenv').config('/.env');
import { deserialize } from 'typescript-json-serializer';
import { Charity } from '../src/models';
import { Tools } from '../src/models';
import { FieldOfAction, UserType } from '../src/enums';

test('Add name of a charity with Charity Model', () => {
    const charityTest = new Charity();
    charityTest.name = 'Front Assoc';
    expect(charityTest.name).toEqual('Front Assoc');
});

test('Add complete iban of a user with Iban Model', () => {
    const charityTest2 = new Charity(
        'Front Assoc',
        'https://frontAssoc.com',
        'the best charity organization in the world to defend front design',
        FieldOfAction.OTHER,
        'data:image/svg+xml;utf8;base64,',
    );
    expect(charityTest2).toMatchObject({
        name: 'Front Assoc',
        url: 'https://frontAssoc.com',
        description:
            'the best charity organization in the world to defend front design',
        fieldOfAction: 'OTHER',
        picture1:
            'data:image/svg+xml;utf8;base64,',
    });
});

test('It deserializes received data to fit Charity Model', () => {
    const data = {
        name: 'Front Assoc',
        url: 'https://frontAssoc.com',
        description:
            'the best charity organization in the world to defend front design',
        fieldOfAction: 'OTHER',
    };
    const finalData = deserialize(data, Charity);
    expect(finalData).toMatchObject({
        name: 'Front Assoc',
        url: 'https://frontAssoc.com',
        description:
            'the best charity organization in the world to defend front design',
        fieldOfAction: 'OTHER',
    });
});

test('It verifies if method returns error with incorrect url for charity website', () => {
    const charityTest3 = new Charity(
        'Front Assoc',
        'wrongUrl',
        'the best charity organization',
        FieldOfAction.CULTURAL,
    );
    return Tools.verify(charityTest3).then((data: any) => {
        expect(data).toBeDefined();
        expect(data[0].property).toContain('url');
    });
});
